function sumFibs(num) {
  let fibSeq = [1, 1];
  let sum = 2;

  while (fibSeq[fibSeq.length - 1] < num) {
    fibSeq.push(fibSeq[fibSeq.length - 1] + fibSeq[fibSeq.length - 2]);
    if ( ((fibSeq[fibSeq.length - 1] % 2) == 1) && (fibSeq[fibSeq.length - 1] <= num) ){
      sum += fibSeq[fibSeq.length - 1];
    }
  }
  return sum;
}

sumFibs(4);
